// App.tsx
import React from "react";
import NotepadList from "./NotepadList";
import NotepadForm from "./NotepadForm";

const App: React.FC = () => {
  return (
    <div>
      <h1>Notepads</h1>
      <NotepadList />
      <NotepadForm />
    </div>
  );
};

export default App;
